import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <div className="App">
      <header className="Better-definitions">
        <h1>
          Better Definitions
        </h1>
      </header>
        <main className={"main-content"}>
            <section className={"Definition-search"}>
                <input/>
            </section>
        </main>
    </div>
  );
}

export default App;
